import "../assets/scss/_navigation.scss";
import logo from "../assets/imgs/Skyz-CRM-Avada-Logo.png";
import { Link } from "react-router-dom";

const navLinks = [
  {
    title: "Home",
    path: "/",
  },
  {
    title: "About",
    path: "/about",
  },
  {
    title: "Login",
    path: "/login",
  },
  {
    title: "Blog",
    path: "/blogs",
  },
  {
    title: "Contact",
    path: "/contact",
  },
];

const Navbar = () => {
  const [menuActive, setMenuActive] =use
  return (
    <header className="navbar">
      <div className="content">
        <Link to="/">
          <img src={logo} alt="logo" className="logo" />
        </Link>
        <div className="links">
          {navLinks.map((link, index) => (
            <Link key={index} to={link.path} className="link">
              {link.title}
            </Link>
          ))}
          <span className="link darkmode-toggle">moon</span>
          <div className="lang">
            <span className="link">
              <b>He</b>
            </span>
            <span className="link">En</span>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
